function EventsList({ locale }){

  const [eventsList, setEventsList] = useState([]);

  useEffect(()=>{
    async function setList(){
      //get list from backend based on locale
      setEventsList(DATA);
    }

    setList();
  }, [locale]);

  function createRows(data, columns) {
    const rows = Math.floor(data.length / columns); // [A]
    let lastRowElements = data.length - rows * columns; // [B]
    while (lastRowElements !== columns) { // [C]
      data.push({ // [D]
        id: `empty-${lastRowElements}`,
        empty: true
      });
      lastRowElements += 1; // [E]
    }

    console.log(data.length);

    return data; // [F]
  }

  return (
    <Container >

      <FlatList
        data={createRows(DATA, 2)}
        renderItem={({ item }) => {
            if(item.empty) return <EventCard style={{opacity:0}}/>
            return <EventCard 
              title={item.title}
              date={item.date}
              time={item.time}
              liked={item.liked}
              imageLink={item.imageLink}
            />
          }
        }
        keyExtractor={item => item.id}
        numColumns={2}
        ListEmptyComponent={() => {return <Text>Lista Vazia</Text>}}
      />

    </Container>
  )
}
